R["oh__@janaaa"]="{['Key']='oh__@janaaa',['Version']=1773,['eu']={[1]={['N']='Little Cat Theatre',['D']='A travelling elsweyr theatre troupe is putting on their new rendition of the adventures of \\'Khunzar-ri and the Lost Alfiq\\' with Fezes in the role of Khunzar-ri and Ezabi in the role of the lost alfiq. Come and enjoy some classical khajiiti theatre!',['C']=1.040000,['O']=19954,},[49]={['N']='Fairy Forest',['D']='A quiet fairy forest haven amidst the swamps of Glenumbra. Stay for a while and watch the lightning bugs fly by. Just be careful where you step, some of the flora has a taste for blood...',['C']=1.031000,['O']=19954,},[3]={['N']='Katzentempel',['D']='Do you yearn for warm sands and bright moons? Then visit this ones home away from home, a shrine to the far away lands of Elsweyr. Come, weary traveller, and rest for a while.',['C']=1.029000,['O']=19950,},[68]={['N']='Gasthaus von Krempen',['D']='This one has opened her humble rimmen home to visitors! Crafting stations included!',['C']=1.500000,['O']=19950,},[70]={['N']='Khajiit Hideout',['D']='A cozy khajiit hideout and trading post for any adventurous cat to stay and rest a while.',['C']=1.041000,['O']=19989,},[42]={['N']='Vivec Spa & Craft',['D']='Ready for a relaxing spa day? Then come visit the Vivec apartment and stay a while. Access crafting stations included.',['C']=1.014000,['O']=19954,},[28]={['N']='Garden in The Rift',['D']='A peaceful garden in the heart of the Rift with a crafting nook and a nice view over the surrounding lakes and rivers. Beautiful at all hours of the day - feel free to play with the time controls :)',['C']=1.031000,['O']=19950,},[13]={['N']='Little Laboratory',['D']='A secret laboratory, belonging to a reclusive magister. Be careful what you touch, some of the artefacts might bite - includes a full set of master crafting stations.',['C']=1.020000,['O']=19951,},[29]={['N']='Brotherhood Tavern',['D']='Just a friendly tavern, welcoming and hearty to any traveler! Or, is it? This place harbours a secret, in fact some might say it harbours criminals...',['C']=1.026000,['O']=19950,},[90]={['N']='Dragon\\'s Guild Hall',['D']='This guild hall is any adventurers one-stop shop for crafting, transmuting, scribing, parsing, vampire utilities and most mundus stones, all under the watchful eye of its gargantuan guardian dragon. \\r\\n\\r\\nUpdate: Now also includes a miniature MoL backyard for runners to practice their routes',['C']=1.010000,['O']=19965,},},['TS']=1727126858,}"
