R["oh__@forestmystic"]="{['na']={[70]={['C']=1.020000,['D']='A mystical jungle sanctuary curated by healers from other dimensions. The main build is over the large water area of the Halls of Colossus and can be accessed near the Statue of Light. The statue beckons you to a hidden pathway that leads you down to the waterfall and beyond!',['N']='Sanctuary of Light',['O']=19513,},[58]={['C']=1.021000,['D']='An elegant oasis away from it all, yet still in the heart of Summerset. This peaceful realm has many areas of opulence and serenity but do make sure to visit the mystical gardens outside the upstairs bedroom. They beckon you to stay there as long as you like, and we hope that you do. Your reservation here is always held.',['N']='Golden Gryphon',['O']=19877,},[83]={['C']=1.014000,['D']='A mystical retreat far away from it all. Peaceful, relaxing, and magical. Set your character to walk mode and stroll leisurely through all the hidden pathways and beautiful locations, all beckoning you to have a seat, relax and enjoy the views wherever you happening to be standing.',['N']='Mystic Mountain Spa',['O']=19956,},},['Version']=1773,['TS']=1724275623,['Key']='oh__@forestmystic',}"
