R["oh__@zackarysensei"]="{['TS']=1718507650,['Key']='oh__@zackarysensei',['Version']=1773,['na']={[104]={['C']=1.037000,['O']=19682,['D']='Most Dunmer\\'s embarks on a pilgrimage to Necrom to bury the dead but some excurse here, where Apocrypha and Morrowind merge, serving as the resting ground for Herma Mora worshipers. \\r\\n\\r\\nLocated above the stairs is the main office. Stay in the commoners area to not disturb any Ciphers of the Eye. The room located near the river is where worship, cremation and ceremonies are held. \\r\\n\\r\\nStay to yourself for Arcanists and proxies of the Prince of Fate come here to safely travel to Apocrypha.  ',['N']='Arcanist\\'s Hideaway',},[109]={['C']=1.051000,['O']=19890,['D']='This house was designed to inspire others, blending practicality with timeless charm.',['N']='Skingrad Inn',},[68]={['C']=1.009000,['O']=19426,['D']='I wanted a unique place for my clothing station, so I turned this house into a fitting room. ',['N']='The Fitting Room',},[101]={['C']=1.051000,['O']=19587,['D']='This is the second house that I have furnished, so it\\'s nothing special. Just a project to develope my decorating abilites. Enjoy :)',['N']='Necrom City House',},[70]={['C']=1.011000,['O']=19713,['D']='This is my first decorated home. There are three \"hidden\" areas - a cat shrine, a mechant/banker shack and a fence location. I have every bust in the game on display. There is no theme, just spontaneity manfest. ',['N']='Rimmen Temple',},[103]={['C']=1.026000,['O']=19874,['D']='I wanted to give ideas to the community since this house was recently added. The cave is still accessible via the rope at the top of the hole. The house is very practical with several custom POI\\'s and a full crafting area. Hope you enjoy.',['N']='Alik\\'r Oasis',},},}"
