R["oh__@fig_theancient"]="{['Key']='oh__@fig_theancient',['TS']=1714874776,['Version']=1773,['na']={[64]={['N']='Great Library Of Fig',['O']=18864,['C']=1.048000,['D']='The Great Library of Fig...lab is in the basement',},[65]={['N']='Workshop Of Fig',['O']=19374,},[99]={['N']='Flagship of Fig',['D']='Eye of Fig has taken to the Seas. Your basic pirate ship in a fantasy realm. Made mostly from furn packs, crown store stuff, Lux furns, and a couple crafted pieces. Beware the Eye!!',['C']=1.020000,['O']=19848,},[70]={['N']='Rimmen Temple',['O']=18864,['C']=1.007000,['D']='Fig\\'s Wedding Chapel and Taxidery...Chapel has Bride\\'s choice of music from all published music boxes in game so far',},[13]={['N']='Camp in the Forest',['D']='Tiny place hidden in the forest...Choses for its central location',['C']=1.007000,['O']=19426,},[47]={['N']='Keep of George',['O']=18864,['C']=1.007000,['D']='Climp the Stairs to pay homage to Goerge.newest of the oblivion Gods.....she seems to be friendly...WIP',},[81]={['N']='Fig\\'s Outlaw Refuge',['O']=18864,['C']=1.007000,['D']='Fig\\'s Outlaws Refuge...The secret is behind the mnoon...good luck',},[82]={['N']='Castles In the Sky',['O']=19096,['C']=1.017000,['D']='I made this for the line \"Still building castles in the sky\" from the song Just The Two Of Us....there are 7 of them...all different styles',},[85]={['N']='Dungeons of Fig',['O']=19337,},[54]={['N']='Eye of Fig Airport',['O']=18898,},[86]={['N']='Vault of Fig',['O']=19164,['C']=1.007000,['D']='A well defended fortress for the vault within',},[56]={['N']='Beyond the Wall',['O']=19130,['C']=1.007000,['D']='Assassin\\'s Guild Entrance to The Wastelands where the three factions experiment with new technologies, while Molag Bal watches and laughs from his Temple of Dark Knowledge.....',},[89]={['N']='Chapel Fig',['O']=18874,['C']=1.051000,['D']='My take on Pantherfang',},[90]={['N']='Eye of Fig Temple',['O']=18998,['C']=1.007000,['D']='There is no escaping the watchfull gaze of the Eye of Fig...It watches over the gateway to the temple of Dagon',},[91]={['N']='Fig\\'s Luxury Hotel',['O']=18964,['C']=1.014000,['D']='',},[60]={['N']='Fig\\'s Assassin Cove',['O']=19060,['C']=1.007000,['D']='This secret base for the forces of Fig, guards its secrets well, as the wrecks in the cove will testify. Used by the master to produce poisons throught Tameriel. Many have tried to access the treasure from the profits locked away there, but few have succeded.',},[93]={['N']='Fig\\'s Observatory',['O']=19031,['C']=1.020000,['D']='Latest project..The Eye of Fig is starting to enter the realm..comes complete with an \\'extraction\\' chair and a skyshard engine..portal back to my housing hub is at the top of the main spire above the telescopes',},[62]={['N']='Castle Fig',['O']=18864,['C']=1.017000,['D']='Castle Fig Main Hub',},[94]={['N']='Fig\\'s Game House',['O']=19108,['C']=1.007000,['D']='Fig\\'s Game House..features a Chess board (which i already got my ass beat on). Sea monster is in the back\\n',},},}"
