R["oh__@nighn_9"]="{['Version']=1773,['Key']='oh__@nighn_9',['TS']=1709861470,['na']={[38]={['D']='Welcome to the Hidden Village! This home is a complete re-skin of Daggerfall Overlook and has a japanese theme. Hope you enjoy!',['C']=1.041000,['O']=19790,['N']='The Hidden Village',},[61]={['D']='Welcome to the Daedric Playground! This home is one of my more difficult labyrinths. As you adventure through the playground, you\\'ll notice Daedric Princes and their rooms are based off of their realms. The goal is to make it to the GIANT skyshard in the sky. Goodluck!',['C']=1.003000,['O']=19790,['N']='Daedric Playground',},[102]={['D']='Welcome to the Evergloam Dream Mill! This is a medium difficulty labyrinth. I styled it with alinor walls and kept most of the evergloam vibe. Goal is to make it to the top of the windmill. Goodluck!',['C']=1.003000,['O']=19790,['N']='Evergloam Dream Mill',},[47]={['D']='As the story goes.. While laying in his death bed, the Duke\\'s two sons waited to find out whom would inherit his castle and gold. In his last breath, the Duke granted the castle and gold to the elder son, and only his horse to the younger son. On the night of the Duke\\'s death, the younger brother was so jealous that he \\rkilled his older brother while he slept. Not long after, the younger brother was overcome with grief and took his own life. Find their gold and put their souls to rest!  ',['C']=1.003000,['O']=19790,['N']='Castle of Lost Souls',},},}"
