R["oh__@pookahthepook"]="{['Key']='oh__@pookahthepook',['na']={[63]={['D']='The small estate of Pookah Woodchurch: Sorceress, scholar, and Sanguinist.',['C']=1.021000,['O']=18979,['N']='Woodkirk Tor',},[34]={['D']='Located in the hills of Southern Bangkorai, this workshop utilises jerry-rigged Dwemer technology in the development of a variety of projects, including an ambitious attempt to create a teleporter capable of reaching beyond the Aurbis and Aetherius (please do not interfere with the maintenance drones, thank you). More mundane technology has been used to create a garden/meditation area outside the workshop proper.',['C']=1.027000,['O']=18979,['N']='Pookah\\'s Workshop',},[22]={['D']='A space for more complex  High Magickal rituals involving working with Aurbic energy and Aedra-summoning. Visitors are welcome to use it if they require such a space for their own work. Just please do not summon any Flame Atronachs, given that the structure is made of wood, and please ensure no entities of -any- kind are allowed past the summoning circle.',['C']=1.037000,['O']=19415,['N']='Kynarthi Chapel',},[28]={['D']='A small home  in a quiet neighbourhood on the outskirts of Nimalten, converted into a gallery (situated in the house proper) and statuary garden. The gallery features tasteful paintings and more 3-dimensional curiosities such as skulls and ritual items. \\nOpen 24 hours, 7 days a week (including the New Life Festival!).\\nNew pieces arrive on an unpredictable basis, so please feel free to re-visit any time!\\n(WARNING: The ferns in the garden are trained to eat thieves. Caveat abector!)\\n',['C']=1.021000,['O']=19402,['N']='Woodchurch Gallery',},[13]={['O']=19535,['N']='Elden Root House',},[6]={['D']='',['C']=1.023000,['O']=18979,['N']='Ser Dren\\'s Lost Tomb',},[47]={['D']='The dying dreams of the renowned adventurer Lord Peter Windbridge, magically rendered as a landscape of living symbols, possiblyconcealing the lost location of his legendary treasure-hoard.\\n\"Be wary in there--Lord Windbridge was an odd duck, and anything could be anything.\"\\n',['C']=1.043000,['O']=19737,['N']='An Adventurer Dreams',},},['TS']=1705302590,['Version']=1773,}"
