R["oh__@perniciouss"]="{['Key']='oh__@perniciouss',['TS']=1691782204,['na']={[81]={['N']='Hjaalmarch Gallery',['C']=1.030000,['O']=18822,['D']='This home has many Antiquities, Collectibles and ESO+ items, as well as other special items from Tamriel.  There are multiple structures constructed outside that blend in with the scenery and have been enhanced with lighting.  Inside, there is a 2nd story and a 3rd story added that blend in with the style of the home.  Occupants roam the house giving a lived in feeling. This is a beautiful home and when visited at night, has an ethereal look to it ouside.  Enjoy!',},[37]={['N']='BMT Headquarters',['C']=1.021000,['O']=19216,['D']='Serenity Falls Estate\\r\\nThis home was made with Khajiit décor in mind. The outdoor has been reforested with flowering and willow trees and lots of plants and has a lighted bridge which casts a beautiful glow across the area at night. The outer-building has services and home crafting stations set up inside and out. The main building is khajiit in style with a trophy hall, kitchen and eating area, and an upstairs area for sleeping quarters and places to relax, such as a nice steamy bath. :)',},[38]={['N']='Pern\\'s Antiquities',['C']=1.021000,['O']=19216,['D']='Estate home full of the many special items that can be found in Tamriel. Upon entering, you will find the temple grounds to your left behind the silver gate, to your right the stable and a hideaway moonlit pool. Upon entering the home, you will find a nicely decorated home with occupants, and with a trophy room in the basement. Going through the trap door takes you out to a beautiful platformed area overlooking the water. ',},[39]={['N']='Ebonheart Manor',['C']=1.020000,['O']=19222,['D']='This Daedric Estate is eerily beautiful and serene, but Daedra can be deceiving. Interlaced throughout the beauty is horrifying acts of crimes against Tamriel\\'s Citizens.\\n\\n',},[89]={['D']='This is a beautiful castle home with a chapel building and a windmill. It has an elegant greenhouse with a water fountain. An area along the outer-wall of the keep has been built-out over the water and close the waterfall, and has a transmute station with home crafting amenities; the banker and merch are inside the home. The main residence is decorated with many of the special furnishing items, antiquities, trophies and ESO+ items and makes it look nice and cozy. There is a kitchen and gambling ',['C']=1.021000,['O']=19580,['N']='Pern\\'s Keep',},[26]={['N']='Pern\\'s Travel Agency',['C']=1.026000,['O']=19490,['D']='Looking to take a trip to Tamriel? We are the agency that can help!  We have every map available to view and can help you with planning your next adventure or campaign.  A stress free atmosphere and R&R are what you will find when you plan your next trip with us!',},[90]={['N']='Deadlands Plot',['C']=1.026000,['O']=19216,['D']='Daedric is the theme here. Enter the fighting cage to test your mettle in close fights! Lighting blasts from the top of the spires. Portals to the left and right. In back you will find a walled in home with a large collection in display cases. As usual, daedric alchemists are collectors of species, including humanoids. LOL This home is truly daedric!!!',},[71]={['N']='Meadowland Retreat',['C']=1.016000,['O']=19485,['D']='An island home done in Khajiit style. A little bit amusement park and alot of relaxation areas.  View the ferris wheel or tilt-o-whirl, or dock area where there are boats and fishing.  OR visit the swimming area with small tents for shade and Bastion is paddleboarding.  Many other tents to use...play cards, rest and relax, enjoy the views. There is a dock with private rooms overlooking the water. A place to get away from it all in paradise island surroundings.  :)',},[62]={['N']='Artaeum Manor',['C']=1.021000,['O']=19216,['D']='An Ethereal home with landscaped gardens and buildings for home crafting, an oceanside bath, and a shipyard that compliment the outdoor area. Inside the home features a multi-level clockwork library in one of the towers, and also has garden areas, living quarters, a bath-house downstairs, and trophy displays interlaced with places to eat and socialize.',},[47]={['N']='Maze of Obstacles',['C']=1.005000,['O']=19216,['D']='Excellent place to test your abilities to follow narrow places without falling off, jump from place to place without missing and falling, and generall all around obstacle course. Split into three sections, falling in any one of them puts you back at the beginning of the section to start over. Great place to run timed events on how long it takes to finish!',},},['Version']=1773,}"
