R["oh__@greviodas"]="{['TS']=1689984971,['Version']=1773,['Key']='oh__@greviodas',['eu']={[80]={['N']='City of Satlin',['D']='Deep within the realm of the Lich Sheol, stands the city of Satlin. Guarding its many citizens within safe from the everlasting blizzards of the wilderness.',['C']=1.041000,['O']=18997,},[26]={['N']='Shrine of Azura',['O']=18489,},[91]={['N']='Home of House Glodas',['D']='The once destroyed Imperial house, Glodas has begun to rebuild. Setting this manor between Cyrodiil and Eslweyr has their new main local.\\n(Taking a break from custom houses to do a simple furnished house)',['C']=1.007000,['O']=18914,},[63]={['N']='Apocrypha',['O']=18833,['C']=1.007000,},[70]={['N']='Arena of the Lost',['D']='A lost Falmer ruin of an old underground arena.\\nDiscovered by the Orodelain Coven, during a incindent now titeled \"The Cursed Sword insident\".\\n\\nThe broken planar portal, now fixed to lead towards the Orodelain Archives.',['C']=1.007000,['O']=18920,},[54]={['N']='Satlin Undercity',['D']='Down in the old town of Satlin, stands the tavern Frozen Bottle. Not many visit this taver, but those who do, are said to go inside and dissapear.',['C']=1.041000,['O']=19002,},[47]={['N']='Sheol\\'s Archives',['D']='Deep in the realm of the Lich of the deep North, Sheol Orodelai. A cathedral floats above the lands as a statue of magnitute towards the God Sheol known as the GodSpirit to the Orodelain people of elemental ice.',['C']=1.007000,['O']=19560,},},}"
