'Contrast']=1,['SizeX']=90,['Yaw']=1.415462,['Id']=1217,},[12]={['X']=32975.207571,['Alpha']=0,['Z']=44548.642284,['SizeY']=235,['MetaData']={['name']='  ',['message']='....you hear movement in the trees....',},['Color']=197999,['EffectType']=594,['SizeZ']=235,['Groups']=0,['Y']=13673,['Pitch']=0,['Roll']=0,['Contrast']=1,['SizeX']=90,['Yaw']=3.433063,['Id']=1218,},[13]={['X']=30327,['Alpha']=0,['Z']=43815,['SizeY']=235,['MetaData']={['name']='Makes-Many-Soups',['message']='We dont get many living folks here..Just the cats, and the monkeys,...and the ghosts...The only ones I have seen, go up to the shrine and never return, curse the Eye. The last one left a journal over there on the altar, in the middle of the village..Perhaps that will help....',},['Color']=197999,['EffectType']=594,['SizeZ']=235,['Groups']=0,['Y']=13688,['Pitch']=0,['Roll']=0,['Contrast']=1,['SizeX']=90,['Yaw']=2.773328,['Id']=1219,},[14]={['X']=32679.986495,['Alpha']=0,['Z']=48131.012810,['SizeY']=235,['MetaData']={['name']='Ghostly woman\\'s voice',['message']='Please free us from the Eye.....*sobs*',},['Color']=197999,['EffectType']=594,['SizeZ']=235,['Groups']=0,['Y']=13697,['Pitch']=0,['Roll']=0,['Contrast']=1,['SizeX']=90,['Yaw']=4.698426,['Id']=1220,},[15]={['X']=35635.832562,['Alpha']=0,['Z']=51530.004543,['SizeY']=235,['MetaData']={['name']='Ghostly voice',['message']='......the fan.....touch the fan.....*moans*...',},['Color']=197999,['EffectType']=594,['SizeZ']=235,['Groups']=0,['Y']=14331,['Pitch']=0,['Roll']=0,['Contrast']=1,['SizeX']=90,['Yaw']=0.006981,['Id']=1221,},[16]={['X']=31684,['Alpha']=0,['Z']=46262,['SizeY']=235,['MetaData']={['name']='Ghostly childs voice',['message']='....*sobs*.....i can\\'t find my mommy.......*sobs*....',},['Color']=197999,['EffectType']=594,['SizeZ']=235,['Groups']=0,['Y']=13602,['Pitch']=0,['Roll']=0,['Contrast']=1,['SizeX']=90,['Yaw']=3.143338,['Id']=1222,},[17]={['X']=31732.117922,['Alpha']=0,['Z']=47500.230288,['SizeY']=235,['MetaData']={['name']='Ghostly old man',['message']='.....the shrine.......Touch the fan....free us from the Eye.....*groans*...',},['Color']=197999,['EffectType']=594,['SizeZ']=235,['Groups']=0,['Y']=13644,['Pitch']=0,['Roll']=0,['Contrast']=1,['SizeX']=90,['Yaw']=4.115486,['Id']=1223,},[18]={['X']=30774.695189,['Alpha']=1,['Z']=45754.545292,['SizeY']=30,['MetaData']={['title']='Worn Journal',['message']='\\n\"Trip of a Lifetime\"\\n\\nI am writing this down as I am the last one here. May it serve as a warning. \\n\\nIts been three months since that Demora lead us here from the slums of Daggerfall on the promise of rich reward. \\n\\nWhen we arrived, there appeared to be an abandoned camp we quickly made our home in. A couple of the Large cats from Elsweyr had made their homes there but they were frendly enough, as long as you didn\\'t enter their caves. Poor Jan\\'th found out the hard way\\n\\n We even made friends with a lizard who calls hinself Make-Many-Soups, who fed us on the many soups he made. \\n\\nI laugh now, but there was something not right with it. I fact nothing seemed right about the forest. i should have listened to my gut then, but it was too late. \\n\\nWe were trapped. \\n\\nThe Demora woman who led us here, went to the keep in the heart of the forest . That as the last that we saw of her, but at night we hear screams that curdle the blood. None have gone up there since. \\n\\nWe keep hearing whispers in the forest, the words \\'shrine\" and \\'fan\\', echos of people long gone. And the MONKEYS! They are everyhere. I can\\'t see them but I know they are there, they keep stealing our supplies\\n\\nDriven mad by whispers, one by one, each member of our expedition venttured into the forest, never to return. \\n\\nI am the last. Makes-Many-Soups is mysteriously quiet on the matter of the missing people, and the large cats aren\\'t talking.\\n\\nI must escape.\\n\\nTommorow, I will set out into the forest to try and find a way out of this hell.....May the gods find a way home for me, but i think the gods have forsaken this place....\\n\\nJon\\'noz',},['Color']=102439,['EffectType']=8501,['SizeZ']=30,['Groups']=0,['Y']=13697,['Pitch']=0.523599,['Roll']=0,['Contrast']=1,['SizeX']=26.456456,['Yaw']=0.853466,['Id']=1226,},[19]={['X']=33860,['Alpha']=1,['Z']=42478,['Groups']=0,['Color']=898989,['EffectType']=921,['SizeZ']=5,['SizeX']=20,['Y']=13802,['Pitch']=0,['Roll']=0,['Contrast']=1,['Id']=1227,['Yaw']=5.045747,['SizeY']=5,},[20]={['X']=32781.374316,['Alpha']=1,['Z']=48422.912563,['Groups']=0,['Color']=898989,['EffectType']=922,['SizeZ']=5,['SizeX']=20,['Y']=13813,['Pitch']=0,['Roll']=0,['Contrast']=1,['Id']=1228,['Yaw']=2.127556,['SizeY']=5,},[21]={['X']=31644,['Alpha']=1,['Z']=46253,['Groups']=0,['Color']=5969,['EffectType']=920,['SizeZ']=18,['SizeX']=18,['Y']=13680,['Pitch']=0,['Roll']=0,['Contrast']=1,['Id']=1229,['Yaw']=4.852015,['SizeY']=18,},[22]={['X']=34653,['Alpha']=1,['Z']=51995,['Groups']=0,['Color']=5969,['EffectType']=920,['SizeZ']=18,['SizeX']=18,['Y']=14533,['Pitch']=0,['Roll']=0,['Contrast']=1,['Id']=1230,['Yaw']=5.288348,['SizeY']=18,},[23]={['X']=33577,['Alpha']=1,['Z']=42799,['Groups']=0,['Color']=5969,['EffectType']=920,['SizeZ']=18,['SizeX']=18,['Y']=13828,['Pitch']=0,['Roll']=0,['Contrast']=1,['Id']=1231,['Yaw']=5.201081,['SizeY']=18,},[24]={['X']=31837.675056,['Alpha']=1,['Z']=47804.493224,['Groups']=0,['Color']=5969,['EffectType']=920,['SizeZ']=18,['SizeX']=18,['Y']=13811,['Pitch']=0,['Roll']=0,['Contrast']=1,['Id']=1232,['Yaw']=0.314159,['SizeY']=18,},},}"
