R["oh__@sparrow_blossom"]="{['Key']='oh__@sparrow_blossom',['na']={[64]={['N']='The Aquarium Lounge ',['D']='Welcome to The Aquarium Lounge. \\nEnjoy a drink and a treasure hunt in our renovated ruins or walk along under the stars and sail our pleasure craft in waterlilly filled ponds. ',['C']=1.012000,['O']=18958,},[33]={['N']='The Franc Foundation',['D']='Welcome to The Franc Foundation, established to celebrate and research the work and life of the ocscure Breton artist Vaermina Franc. ',['C']=1.030000,['O']=19033,},[35]={['N']='Casafranca',['D']='Welcome to Casafranca !! Rick Franc\\'s Cafe Tamrieliane. This is the 7th build around my fictional Franc family. This build is based on the set design of the 1942 film \"Casafranca\" with an artwork of a piano man as a nod to one of the film most famous lines -\"Play it again Sam\"',['C']=1.024000,['O']=19118,},[20]={['N']='The Kiss',['D']='A dedication to the artist Gustav Klimt who painted the work this build is based on. Possibly one of the most famous depictions of love - the artist had 14 children, never married and lived at home with his mother and unmarried sisters.',['C']=1.030000,['O']=19159,},[5]={['N']='The Franc Collection',['D']='Welcome to The Vaermina Franc Gallery of Fine Art.\\nAn curated exhibition celebrating the work of the obscure Breton artist Vaermina Franc.\\nPlease do not touch the art works. \\nFree Entry. \\n',['C']=1.030000,['O']=19012,},[58]={['N']='Poe\\'s Study ',['D']='Poe\\'s Study - a build in my ongoing Franc family series. EHT is recommended but not necessary to view this build. There is an EHT book by the entrance.',['C']=1.023000,['O']=19211,},[10]={['N']='The Room of Birds',['D']='Inspired by a decorative ceiling by the architect. interior designer and artist Antoni Gaudi (1852-1926)  housed at his first commision - \\'Casa Vicens\\' (built 1883-1888) in Barcelona, Spain. ',['C']=1.030000,['O']=19105,},[61]={['N']='Temple and Deer Park',['D']='Welcome to my Temple and deer park, where you can meditate in the sand garden, stroll the pathways and contemplate the views. A herd of deer may follow in your steps.',['C']=1.037000,['O']=18994,},[81]={['N']='Meridia Winery',['D']='Welcome to Meridia Winery. Our special clensing brew has been blessed by the light of the Lady. Enjoy a wine and cheese platter and relax by the waterfall or bathe in the pool of Infinite Energies. Tours are available with tastings. ',['C']=1.021000,['O']=18958,},[13]={['N']='Water Lily Exhibit',['D']='Welcome to The Claudette Monet-Franc Water Lily Exhibit, featuring a 360\\' vertical art work. A creation of a member of that obscure pioneering family established by Vaermina Franc, this serener space is the perfect location to get away from the hustle and bustle of Graftwood.\\nBuilders note: This is my humble tribute to the IRL artist Claude Monet (1840-1926 France) and his stunning paintings he made late in his life when the artist was alomost completely blind.',['C']=1.030000,['O']=19011,},[17]={['N']='Franc Detective',['D']='Franc Detective Agency - A flm noir inspired build as part of my ongoing Franc family inspired builds. ',['C']=1.050000,['O']=19070,},[31]={['N']='Sigmund Franc Room',['D']='The Franc Foundation presents Sigmund Franc\\'s consulting room. Part 5 of my story cycle about the fictional Franc family. Based on Freud\\'s rooms in Vienna IRL ',['C']=1.030000,['O']=19048,},},['TS']=1659878765,['Version']=1769,}"
