R["fx__na__@sparrow_blossom__33"]="{['Effects']={[1]={['X']=0,['Z']=0,['SizeZ']=100,['SizeY']=100,['Id']=1229,['Groups']=0,['Contrast']=1,['Y']=0,['Color']=494949,['Pitch']=0,['SizeX']=100,['Alpha']=1,['Yaw']=0,['Roll']=0,['EffectType']=614,},[2]={['X']=47086.433546,['Id']=1230,['MetaData']={['message']='FRANC\\n',},['SizeZ']=222,['SizeY']=222,['Contrast']=1.820000,['Groups']=0,['Pitch']=6.195919,['Y']=18569,['Color']=4255,['Z']=57790.502132,['SizeX']=420,['Alpha']=1,['Yaw']=3.752458,['Roll']=0,['EffectType']=4405,},[3]={['X']=48286,['Id']=1231,['MetaData']={['message']='This is not a pipe',},['SizeZ']=60,['SizeY']=60,['Contrast']=0.500000,['Groups']=0,['Pitch']=0,['Y']=8287,['Color']=40606,['Z']=61301,['SizeX']=500,['Alpha']=0.910000,['Yaw']=4.495968,['Roll']=0.003491,['EffectType']=4407,},[4]={['X']=48064.490820,['Id']=1237,['MetaData']={['message']='The Twins\\n\\nIt is not known exactly which set of twins this work refers to. There are several possibilities debated by scholars including Jorunn the Skald Prince and his brother Fildgor Strong Prince (aka Angry Prince) or the Llambris twins. There are some who insist it relates to an obscure reference of twin sisters that can be found in Auridon. This claim is lent some credence as it is known from remnants of the artists diary that the wolf component was discovered in a ruin near the river that runs east of Vukhel Guard.\\nIt is also known as the \"I\" statue due a rough inscription on the base that reads -\\n\\n              \" I came to Auridon,\\n                I saw Auridon,\\n                I beat all the chaps in the inn at\\n                Auridon.\\n                                                           V\"\\n\\nRomulus and Remus Statue - The ancient original of this work represents the foundation myth of the Romans. The she-wolf is thought to date earlier than the figures possibly Etruscan. ',['title']='The Twins or \"I\" Statue',},['SizeZ']=90,['SizeY']=90,['Contrast']=2.460000,['Groups']=0,['Pitch']=0,['Y']=8345,['Color']=498698,['Z']=60202.629390,['SizeX']=66.456456,['Alpha']=1,['Yaw']=3.895575,['Roll']=0,['EffectType']=8503,},[5]={['X']=48050.626128,['Id']=1238,['MetaData']={['message']='This is Not a Pipe\\n\\nThis is a very strange work. It is obviously a pipe. \\n\\nRene Magritte (1898-1967) Belgium\\n\\'Ceci n\\'est pas une pipe\\' 1929, which translates to \\'This is not a pipe\\'\\n \\nSurrealist artist - The original of this work was reproduced in lithographic prints. It is a take on the construction of language, communication and perception. Indeed, the original is not a pipe, it is a paper print that has a pipe represented on its surface, not an actual pipe. ',['title']='This is Not a Pipe',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=6.279695,['Y']=8429.400000,['Color']=668699,['Z']=61893.634841,['SizeX']=106.456456,['Alpha']=1,['Yaw']=0.568977,['Roll']=6.279695,['EffectType']=8503,},[6]={['X']=50783.433100,['Id']=1239,['MetaData']={['message']='Fish\\n\\nAfter Hokusai (1760-1849) and Hiroshige (1797-1858) Japanese artists of the late Edo period (1603-1897)\\n\\nJapanese woodcuts and prints particularly of the Edo period are some of my favorite art works. These artists worked within what was a mostly closed off existence from the rest of the world. When Japanese style prints began to appear in Europe in the mid to late 19th century they were enourmously influential in the new art of the time. Vincent Van Gogh\\'s works were dark and brooding in his early career, it was his exposure to the flat bright colors and distinct lines of Japanese prints that inspired him to become one of the most vibrant and collectible artists of the early modern era.\\nThe emphasis on realism (albeit stylised) and the study of the natural word was also very important to the European artists of the late 19th century, particularly the impressionists. Caillebotte\\'s most famous work \"The Floor scrapers\\' 1875, depicts three workers cleaning old varnish off a floor for his new studio. It was a metaphor for stripping away the old heavily varnished ways of the past and embracing the new. \\nCaillebotte\\'s painting also features domestic city dwelling labourers, also a common theme in Japanese work cuts.\\n',['title']='Fish',},['SizeZ']=90,['SizeY']=90,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8532,['Color']=559398,['Z']=57463.683230,['SizeX']=66.456460,['Alpha']=1,['Yaw']=5.387830,['Roll']=0,['EffectType']=8503,},[7]={['X']=45884.579885,['Id']=1240,['MetaData']={['message']='The Librarian of Vivec\\n\\nThis portait of dumer Chief Librarian Bradyn is remarkable in that there is a living link between the sitter and the artist. Braydyn himself describes the experience as \\'fascinating and frightening\" where Franc would appear to be in an almost trance like state and then suddenly scream very loud and then work at a frenzied pace before repeating the cycle. Bradyn was several centuries younger at the time and has been quoted saying \" I don\\'t think my heart would cope these days.\"\\nThis rare oppurtunity to explore Franc\\'s life and methods are currently part of a research program established by the Franc Foundation. Indeed study of her diaries and cross referencing with official documents have led scholars to believe that Franc made similar potraits of the King and Queen of the Bosmer from vegetables and flowers. \\n\\nGiuseppe Archimboldo (1526 or 1527- 1593) Italy\\n\\'The Librarian\\' 1566\\n',['title']='The Libraian of Vivec',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=6.262241,['Y']=8442,['Color']=467998,['Z']=61514.761113,['SizeX']=106.456456,['Alpha']=1,['Yaw']=2.181662,['Roll']=0,['EffectType']=8503,},[8]={['X']=45156.238138,['Id']=1241,['MetaData']={['message']='Franc\\'s Mother\\n\\nIt is assumed that the words \"My Mother\" scrawled on the back of this work were written by Franc herself. It has always been titled as such and the letters do appear to match the handwriting on the remnants of the artisits diaries. \\nHowever further research has revealed that the clothing worn by the sitter does not match that of period Breton fashion, indeed it does not appear  in any known records throughout Tamriel. \\nThis work was formerly housed in the basement of The Temple of the Divines in Wayrest where it was held in storage for an unknown length of time.\\nLocal legend has it that one of the former head priests was so haunted with nightmares of his own mother and that he ordered it banished it from sight.\\n The Franc Institute is grateful for their generous donation.\\n\\nJames McNeill Whistler (1834-1903) USA\\n\\'Whistler\\'s Mother\\' 1871',['title']='Franc\\'s Mother',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8445,['Color']=558698,['Z']=60378.817616,['SizeX']=106.456456,['Alpha']=1,['Yaw']=2.220059,['Roll']=0,['EffectType']=8503,},[9]={['X']=47198.539365,['Id']=1242,['MetaData']={['message']='The Screaming Monk\\n\\nFrancs diaries reveal that the artist had visions of being seperated from her companions in the mountains of Vvardenfell and heard an unearthly scream ring out amongst the hills. This is one of the few records that exist that describe a vision sent to Franc by the Daedric Prince.\\nThis work has been recently recovered due to an investigation led by Detective Jack Franc, a descendant of the artist. It was stolen in broad daylight at sword point from a gallery in Wrothgar by thieves who couldnt explain why they felt compelled to do so. The records of the Art Gallery of Wrothgar reveal that this has happened on several different occaisions. \\n\\nEdvard Munch (1863-1944) Norway\\n\\'The Scream\" 1893 \\n\\nBuilders Note: Jack Franc\\'s Detective Agency can be found at Ravenhurst',['title']='The Screaming Monk',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8405,['Color']=488497,['Z']=59002.705562,['SizeX']=106.456456,['Alpha']=1,['Yaw']=5.323254,['Roll']=0,['EffectType']=8503,},[10]={['X']=47446.506817,['Id']=1243,['MetaData']={['message']='The Kiss\\n\\nThis work may share the same title as another that can be found in official records. There is a hand written note in the margins of an auditing document next to a record of a work of this title by the artist. It is thought to be by a scribe to the Redguard Royal family that reads -\\n\"The GOLD!!! Sheogorath take me, Oh the GOLD!!\" \\nThis statement does not seem to apply to this work as there is no gold to be found in its materials.\\nHowever Redguard records are notoriously fractured and incomplete, therefore it has been diffilcult to ascertain that there is a different work sharing the same title and if it ever existed and still does.\\n\\nFrancesco Hayez (1791-1882) Italy\\n\\'The Kiss\\' 1859\\n',['title']='The Kiss',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8440,['Color']=558397,['Z']=62292.416927,['SizeX']=106.456456,['Alpha']=1,['Yaw']=3.769911,['Roll']=0,['EffectType']=8503,},[11]={['X']=51269.388230,['Id']=1244,['MetaData']={['message']='The Mirri Lisa\\n\\nThis is possibly the most well known work of Franc\\'s and we at the Foundation are determined to make her name known in every household across Tamriel.\\n Records show that this was one of the few commisioned works that we know of by Franc, however it was not delivered. Franc carried this work with her until her death. It is believed that it was found in her studio.\\nIt is not known exactly who Mirri Lisa was, scholars debate whether she is the wife of a Dunmer noble or possibly a merchant of strider shells.\\nShe mysteriously never smiles.\\n\\n\\nLeonardo Da Vinci (1452-1519) Italy\\n\\'The Mona Lisa\\' Worked betwenn 1503 until the artists death',['title']='The Mirri Lisa',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8394,['Color']=468397,['Z']=59768.559385,['SizeX']=106.456456,['Alpha']=1,['Yaw']=3.752458,['Roll']=0,['EffectType']=8503,},[12]={['X']=50654.700271,['Id']=1245,['MetaData']={['message']='Still Life with Skooma\\n\\nThis image represents what may be one of the most publically frenetic periods of Franc\\'s life. Much conjecture has surrounded around the artists temporary struggles with skooma but further research cross referencing apothecary records and detention and court records have revealed that the extroadinary tales of Franc being disorderly, harrassing local residents, brandishing a dagger at her fellow lodgers and threatening to cut her own ear off are infact based in fact. It appears that her own brother Theo was compelled to admit Vaermina to a sanatorium for a period at this time. \\nIt seems that once this body of work was complete Franc ceased her consumption of large amounts of skooma as arrests and nuisance complaints cease.\\n\\nVincent Van Gogh (1853-1890) Holland\\n\\'Still life with absinthe\\' 1887\\n',['title']='Still Life with Skooma',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8405,['Color']=548498,['Z']=60149.640793,['SizeX']=106.456456,['Alpha']=1,['Yaw']=3.839724,['Roll']=0,['EffectType']=8503,},[13]={['X']=50777.899161,['Id']=1246,['MetaData']={['message']='Landscape - The Moutain (Always the Moutain)\\n\\nKatsushika Hokusai (1760-1849) Japan. \\nMost famous for his ubiquitous \\'Great Wave\\' - this print is from his celebrated works \\'Thirty-Six views of Mt Fuji\" (1830-32)\\n Created from woodblock prints these images were both widely \\ncirculated and popular with his life time.\\n   \" I have drawn things since I was 6. All that I have made before the age of 65 is not worth counting. At 73 I began to understand the true constuction of animals, plants, trees and insects. At 90 I will enter into the secret of things. At 110, everything - every dot, every dash - will live. \\nTo all of you who are going to live as long as I do, I promise to keep my word. I am writing this in my old age, I used to call myself Hokusai, but today I sign myself \\'The Old Man Mad About Drawing.\"\\nHokusai. \\n\\nI myself live IRL in a tiny island capital city sandwiched between the Great Southern Ocean and the beautiful granite moutain that dominates views looking back from the sea (and my kitchen window)\\n',['title']='Landscape - The Moutain (always the Moutain)',},['SizeZ']=90,['SizeY']=90,['Contrast']=1.500000,['Groups']=0,['Pitch']=0,['Y']=8346,['Color']=488298,['Z']=57468.910267,['SizeX']=66.456460,['Alpha']=0.880000,['Yaw']=5.393067,['Roll']=0,['EffectType']=8503,},[14]={['X']=48382.848850,['Id']=1247,['MetaData']={['message']='Dancers ?\\n\\nIt seems that Franc herself was unsure of what her vision entailed regarding this work. The figures do seem to gyrate in a strange manner. \\nThe fragments of her diary regarding this work reveal that Franc though she had to \" ...\"Go to the ballay\" but i dont know what that means, I will ask...\". (Fragment ends there) \\nShe also mentions \"music with guts like those cats play.\" It is widely acknowledged by scholars that  Franc is refering to the string instuments of the Khajit. There is some argument amongst musical gurus that this is proof that music is truly universal, including that from possible alternative dimensions. Although many proffessional scholars dispute this, dismissing it as \"a fantasy based on consuming bad substances.\"\\n\\n\\nEdgar Degas (1834-1917) France\\n\\'The Blue Dancers\\' (Circa 1880s)',['title']='Dancers',},['SizeZ']=190,['SizeY']=190,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8386,['Color']=559197,['Z']=58286.467320,['SizeX']=146.456460,['Alpha']=1,['Yaw']=2.181660,['Roll']=0,['EffectType']=8503,},[15]={['X']=49422.242650,['Id']=1248,['MetaData']={['message']='I Heart Flowers\\n\\nThis deceptively beautiful work holds a dark history. Records from the Royal treasury of Queen Ayrenn show that Franc was gifted  \"One carriage by Pimped Out - makers of custom travel wares including all supplies, sundrys inc one extra loud music box, two drivers and four footman.\"  \\nUnfortunately there was a terrible accident or incident which resulted in the loss of the carriage and the staff provided. The exact details of the affair are unknown. The records are strangely silent on the matter.\\nFranc had the hearts of her employees preserved and they now form the floral elements of this work.\\n\\n\\nGustav Caillebotte (1848-94) France \\n\\'Nasturtians\\' 1892',['title']='I Heart Flowers ',},['SizeZ']=110,['SizeY']=110,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8346,['Color']=508997,['Z']=58831.515084,['SizeX']=86.456456,['Alpha']=1,['Yaw']=5.235988,['Roll']=0,['EffectType']=8503,},[16]={['X']=49546.370320,['Id']=1249,['MetaData']={['message']='Map of Vvaredenfell \\n\\nBraydyn the Librarian and map maker of Vvardenfell has acknowledged that he gifted Franc a copy of his model in exchange for his portrait, however he admits he has no knowledge of why Franc may have marked one of the off shore islands in red. \\nScholars have postulated that it may have been the location of one of Franc\\'s secret studios or of an object used in one of Franc\\'s works. However no records exist to provide any further information at this point in time. The Franc Foundation\\'s mission is too broaden not only the collection of Franc works but our knowledge and understanding of the artist.\\nInvestigations continue not only at our foundation but across all of Tamriel and its known dimensions.\\n',['title']='Map of Vvardenfell - A hidden secret',},['SizeZ']=110,['SizeY']=110,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8365,['Color']=517399,['Z']=58344.205926,['SizeX']=86.456456,['Alpha']=1,['Yaw']=3.738495,['Roll']=0,['EffectType']=8503,},[17]={['X']=50160.057366,['Id']=1251,['MetaData']={['message']='My Mate, Sidney/Sydney \\n\\nThe title of this work is written on the back in what could possibly be blood.\\nDespite the terrifying aspect, Franc\\'s diaries descibe the sitter as a \"good bloke\" and a \"folk hero.\"  Scholars are currently debating the meaning of the word \\'bloke\\' as it doesn\\'t appear in any texts of Tamriel or its known dimensions. It is thought to be complimentary.\\nLike wise the origin of the words Sidney/Sydney ( It is unclear whether it is spelt with the letter I or Y) is also unknown. It is assumed to be the name of the sitter but as the title includes a comma it is unclear if it is a name of a person, another realm or even a deity. \\nSome scholars have suggested diary fragments that repeat the phrase \\'Under Down, Under Down, Bloody shrimps on barbies !!\" may refer to this work.\\nHer diaries also mention \"...giant bloody rats with pockets and a sun so hot that you could cook eggs on a rock. Isn\\'t that right Ned.\" \\nWhy this figure appears to be armed is unknown, as is the style of armour. Likewise the object held by the sitter is unfamilar. Some weapons experts have suggested that its a form of ceremonial spear, whilst others a protype of a miniature personal canon. However the latter is generally dismissed as ridiculous. \\n\\nSidney Nolan (1917-1992) Australia\\n\\'Ned Kelly\" 1946\\n',['title']='My Mate, Sidney/Sydney',},['SizeZ']=110,['SizeY']=110,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=8385,['Color']=559097,['Z']=59488.895735,['SizeX']=86.456456,['Alpha']=1,['Yaw']=0.478220,['Roll']=0,['EffectType']=8503,},[18]={['X']=43257.170344,['Id']=1252,['MetaData']={['message']='This Japanese inspired work has the word \\'suzume\\' in hiragana, which translates to sparrow.',['title']='Untitled No 1',},['SizeZ']=130,['SizeY']=130,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=18255,['Color']=80154,['Z']=55372.862191,['SizeX']=86.456456,['Alpha']=1,['Yaw']=1.134464,['Roll']=0,['EffectType']=8503,},[19]={['X']=48298.720778,['Id']=1254,['MetaData']={['message']='Donors',},['SizeZ']=24,['SizeY']=24,['Contrast']=1.060000,['Groups']=0,['Pitch']=0,['Y']=8502,['Color']=44679,['Z']=58723.074004,['SizeX']=47,['Alpha']=1,['Yaw']=0.537561,['Roll']=0,['EffectType']=4405,},[20]={['X']=48297.390539,['Id']=1255,['MetaData']={['message']='Sigmund Franc III\\n\\nThe Temple of The Divines \\n\\nLord Vehk of The Tribunal \\nand the Libraians of Vivec\\n\\nThe Unforseen Queen -\\n Ayrenn Arana Aldmeri\\n\\nVanus Galerion \\n\\nThe Antiquarian Circle\\n\\n\\n\\n\\n',},['SizeZ']=102,['SizeY']=102,['Contrast']=1.500000,['Groups']=0,['Pitch']=0.073304,['Y']=8423,['Color']=104068,['Z']=58724.861209,['SizeX']=102,['Alpha']=1,['Yaw']=0.561996,['Roll']=0,['EffectType']=4405,},[21]={['X']=47685.778989,['Id']=1257,['MetaData']={['message']='If you enjoyed this gallery we \\ninvite you to visit our other \\nexhibitions at \\nThe Sisters of the Sands Apt\\nSnugpod\\nGolden Gryphon Garret\\nHammerdeath Bungalow\\n Ravenhurst\\n    ',},['SizeZ']=100,['SizeY']=100,['Contrast']=1,['Groups']=0,['Pitch']=6.237807,['Y']=8402,['Color']=407698,['Z']=59179.082572,['SizeX']=101,['Alpha']=1,['Yaw']=0.527089,['Roll']=0,['EffectType']=4405,},[22]={['X']=47495.624421,['Id']=1272,['MetaData']={['message']='Welcome,\\nThis gallery, education and research institute was established to celebrate and develop our knowledge and understanding of the Tamrielian artist Vaermina Franc.\\nFranc was born the seventh child of Breton peasant farmers Albert and Muriel Franc. In an attempt to instill a sense of destiny in her daughter, her mother named her after the Daedric Prince. Rather than bestowing dreams of prophesy, Franc was plauged with visions and words both familiar and strange that compelled her to walk the length and breadth of Tamriel in search of items to recreate her visions and thus endeavor to rid herself from them.\\nIt has been speculated by scholars that these visions may originate from a yet unknown plane beyond Tamriel and its other known dimensions. Although the nature of these works and associated documentation may said to be evidence of that - it has not been proven to date.\\nSadly in her later years Franc burnt many of her works and diaries, however efforts are being made to recover and consolidate what remains. There are scholars and friends of The Franc Foundation that have set out scouring Tamriel, in the same tradition as Franc herself, searching for lost works, fragments and documentary evidence that may have survived. \\nWe Thank the scholars, donors and others who have made the creation of this gallery and our foundation possible.\\n\\nThe Curator\\nThe Franc Foundation\\n\\nBuilders Note: \\nI deeply and sincerly give my respect to the truly great real life artists who have inspired me to build this gallery of pixels in ESO.\\nI stand on the shoulders of giants\\nWith all my heart,\\nSparrow Blossom\\n',['title']='The Franc Foundation',},['SizeZ']=110,['SizeY']=110,['Contrast']=1,['Groups']=0,['Pitch']=0,['Y']=18034,['Color']=579988,['Z']=58298.771277,['SizeX']=106.456456,['Alpha']=1,['Yaw']=3.735005,['Roll']=0,['EffectType']=8503,},},['Version']=1767,['TS']=1651382327,}"
