R["fx__na__@sparrow_blossom__17"]="{['Version']=1767,['TS']=1647686766,['Effects']={[1]={['Y']=10141,['Color']=598898,['Pitch']=6.262241,['Id']=1263,['Roll']=0,['SizeX']=101,['Groups']=0,['SizeY']=59,['Contrast']=0.940000,['X']=57686.250506,['MetaData']={['message']='  Franc\\nDetective\\n Agency',},['Yaw']=2.541199,['EffectType']=4400,['SizeZ']=59,['Alpha']=0.800000,['Z']=31859.076236,},[2]={['Y']=10117,['Color']=447790,['Pitch']=0,['Id']=1268,['Roll']=0,['SizeX']=100,['Groups']=0,['SizeY']=80,['Contrast']=0.640000,['X']=57230.066460,['MetaData']={['message']='  Franc\\nDetective \\n Agency\\n',},['Yaw']=4.070110,['EffectType']=4400,['SizeZ']=80,['Alpha']=0.750000,['Z']=32417.044840,},[3]={['Y']=10135,['Color']=599398,['Pitch']=0,['Id']=1269,['Roll']=0,['SizeX']=89,['Groups']=0,['SizeY']=46,['Contrast']=0.600000,['X']=57648.405230,['MetaData']={['message']='  Franc\\nDetective\\n Agency',},['Yaw']=2.523750,['EffectType']=4400,['SizeZ']=46,['Alpha']=0.660000,['Z']=31922.326190,},[4]={['Alpha']=1,['Color']=318699,['Pitch']=4.712564,['Id']=1270,['Roll']=0,['Y']=9801,['Groups']=0,['X']=57893.558530,['Contrast']=1,['SizeX']=46.456456,['MetaData']={['title']='The Case of The Screaming Monk',['message']='It had been a humid day, the air was still as thick as a Nord and I was waiting for the cool of the evening to wash over the streets.            I had just wrapped up the case of The Screaming Monk, a strange affair involving an artwork by a distant relative of mine, a mysterious woman and a daedric prince.        The opening do at the Franc Foundation wasn\\'t really my kind of thing. The women were too shrill and the men too slippery. Although it was satisfying to see the artwork installed with all those others, considering the collateral damage it  was responsible for.            I left early with a growing headache drumming in my skull and a nagging feeling.            Did that sharp skink really throw me a tip to salve her conscience and her Orc fiance from the gallows ? I hadnt been able to make the connection between the Orc brothers and the gallery owners nephew.                                          I am beginning to wonder whether her motivation was justice or revenge...',},['Yaw']=1.221730,['EffectType']=8503,['SizeY']=70,['SizeZ']=70,['Z']=32732.052332,},},}"
