R["fx__na__@sparrow_blossom__31"]="{['Version']=1767,['Effects']={[1]={['Groups']=0,['Yaw']=5.539675,['Alpha']=1,['Y']=20165,['Z']=23689.198954,['Roll']=0,['EffectType']=8503,['X']=28152.630540,['SizeZ']=60,['MetaData']={['title']='Sigmund Franc\\'s Consulting Room',['message']='The Franc Foundation presents Sigmund Franc\\'s consulting room. \\nSigmund Franc was the nephew of the Tamrielian artist Vaermina Franc who was instrumental in Sigmund\\'s development of the \"talking cure.\"\\nVaermina\\'s \\'The Night (mare) wolf\\' (On view at The Sisters of the Sands Apt -a small gallery of the artists work) was part of the inspiration behind his theories about dreams and their meanings.\\nScholars suggest it may have been attempting to understand if not cure his aunt\\'s affliction the true motivation. Like many members of the Franc family Sigmund appears to have an addiction to art particulary sculpture and ancient artifacts.\\nBuilders Note: This is a recreation of the IRL rooms of Sigmund Freud at Bergasse 19, Vienna, Austria just as the country was being annexed by the Nazi\\'s in 1938. The phographs were taken by a young Jewish photographer Edmund Engelman briefly before Engelman, Freud and his family escaped to England. Freud was obsessed with sculpture having over 300 items of his collection, mostly figurative that were transported to England along with his household and beloved dogs. Freud died within a short time of arriving in England, having suffered from cancer of the palette for many years. The door on the left is the entrance for the room where Freud received treatment. Freud had a print of Fuseli\\'s The NIghtmare in his waiting room\\nThe painting to the right of the couch is a recreation of \\'Oedipus and the Sphinx\\' by Ingres, 1808. The female figure refers to \\'Gradiva\\' The bust in the corner of Abnur is a reference to the marble head of the Emperor Augustus called \\'The Good Citizen\\'. The portrait with the red hat is Rembrant, the cups on the table are kiddush cups, references to Freud\\'s Jewish heritage. All these things influenced Freud\\'s work and theories. ',},['Id']=1258,['SizeX']=46.456456,['Color']=994044,['SizeY']=60,['Pitch']=5.242969,['Contrast']=1,},[2]={['Z']=23711.705564,['Yaw']=2.335251,['Alpha']=1,['SizeY']=34,['Groups']=0,['Roll']=0,['MetaData']={['title']='The Franc Foundation Galleries and Exhibitions',['message']='The Franc Foundation Galleries and Exhibitions welcome visitors to our other displays -\\n\\n1. The Franc Gallery - The Sisters of The Sands Apt\\n\\n2. The Water Lilly Exhibit - Snugpod\\n\\n3. The Franc Foundation - main gallery, research and education facility - Forsaken Stronghold\\n\\n4. Poe\\'s Study - Golden Gryphon Garret',},['X']=28131.409779,['SizeZ']=34,['Contrast']=1,['Id']=1261,['SizeX']=28.456456,['Color']=998134,['Y']=20109,['Pitch']=0,['EffectType']=8503,},},['TS']=1645771117,}"
