R["fx__na__@sparrow_blossom__5"]="{['Effects']={[1]={['Groups']=0,['EffectType']=8503,['Contrast']=1,['Id']=1190,['Z']=25847.332844,['Alpha']=1,['Color']=102439,['X']=26164.891145,['Roll']=0,['Pitch']=0,['SizeX']=66.456456,['SizeY']=110,['SizeZ']=110,['Y']=20308,['Yaw']=4.712389,['MetaData']={['title']='The Vaermina Franc Gallery',['message']='Welcome to \\nThe Vaermina Franc Gallery\\n\\nThe artist was born the seventh child of Breton peasant farmers Albert and Muriel. In an attempt to instill a sense of destiny in her daughter, her mother named her after the Daedric Prince. Rather than bestowing dreams of prophesy Vaermina was plauged by images and words both familiar and strange that compelled her to walk the length and breadth of Tamriel in search of items to recreate her visions and thus endeavor to rid herself from them. \\nIt has been said that these visions originate from a plane beyond Tamriel and although the nature of some of these work may said to be evidence of that - it has not been proven to date.\\nSadly in her later years in a fit of insanity Vaermina burnt the majority of her work and journals. However those who admire her work have set out scouring Tamriel, in the same tradition as Vaermina herself, searching for lost masterpieces or even fragments that may have survived. Indeed you too may have an original Franc boarding up the hen house.\\n\\nWe thank the various scholars who have contributed their knowledge to this gallery. \\n\\nThe Curator\\n',},},[2]={['Groups']=0,['EffectType']=8503,['Contrast']=1,['Id']=1191,['Z']=26187.793327,['Alpha']=1,['Color']=102439,['X']=26175.292750,['Roll']=0,['Pitch']=0,['SizeX']=26.456460,['SizeY']=30,['SizeZ']=30,['Y']=20229,['Yaw']=4.712390,['MetaData']={['title']='Vanitas, omnia vanitas',['message']='Vanitas, omnia vanitas\\n\\n\\nStill life - scholars generally agree that this work represents the transience of life and the inevitability of death. This is why the glass and the coins sit precariously on the edge. The flowers will wither and the candle snuff out.\\n\\nThis title of this work was previously incorrectly cataloged as \"Drink. love and be merry, for tomorrow you may die.\" Further research has revealed the original title was changed when the painting was inherited by the son of a Dunmer noble who had special dispensation to trade in wine granted by a Breton Queen and this work was used for advertising the business. The image became well known in its day as it was reproduced in woodcut prints.',},},[3]={['Groups']=0,['EffectType']=8503,['Contrast']=1,['Id']=1192,['Z']=26272.140402,['Alpha']=1,['Color']=102439,['X']=26172.461901,['Roll']=0,['Pitch']=0,['SizeX']=26.456456,['SizeY']=30,['SizeZ']=30,['Y']=20229,['Yaw']=4.712389,['MetaData']={['title']='The Maid',['message']='The Maid\\n\\n\\nAlthough it has been speculated that Franc used an optical device to create this potrait no such instrument has been found. some have postualted that she may have discovered a dwemer device. Whereas others believe the accounts that it may have been wood and glass in construction and was destroyed by Franc herself in the pyre of her work. \\n\\nIt has been suggested that this may be a portrait of either the artists sister or wife. Records show that Vaermina remarried a Nord named Katisha later in life, after the birth of her children, although there is some uncertainty to the actual year this occurred.\\n\\n',},},[4]={['Groups']=0,['EffectType']=8503,['Contrast']=1,['Id']=1193,['Z']=26563.509557,['Alpha']=1,['Color']=102439,['X']=26013.309103,['Roll']=0,['Pitch']=0,['SizeX']=26.456456,['SizeY']=30,['SizeZ']=30,['Y']=20249,['Yaw']=0,['MetaData']={['title']='Bike: After Duchamp',['message']='Bike: After Duchamp\\n\\nThis is the most enigmatic of Franc\\'s works. No scholar can agree on whether this is the represetation of an animal, a man, an object or even a deity ? Likewise, there is no agreement on the pronunciation of the term \"Bike\" as it does not appear in any language of Tamriel or dimensions known to scholars. \\nThe utter unknowability of this work has been seen as evidence that Franc\\'s visions did indeed manifest from a dimension we are unaware of, although this has not been proven nor has any concensus been concluded by the majority of scholars.\\n\\nBuilders note - In Duchamp\\'s original he took the seat and handle bars of a bike and presented them as \"Bull\\'s Head\" 1942. I have taken the ancestor of the modern bull and turned it into a bike. Inverting Duchamp :)\\n\\n',},},[5]={['Groups']=0,['EffectType']=8503,['Contrast']=1,['Id']=1195,['Z']=26591.752871,['Alpha']=1,['Color']=102439,['X']=25636.047122,['Roll']=0,['Pitch']=0,['SizeX']=26.456456,['SizeY']=30,['SizeZ']=30,['Y']=20252,['Yaw']=0.073304,['MetaData']={['title']='Vincent',['message']='Vincent\\n\\nThere are virtually no reliable records about this little known work, other than it was recently discovered under conditions the donor (anonymous) wishes to remain out of the public knowledge, therefore any history behind the title has been lost. It is possibly part of series of Franc\\'s works featuring the colors of the natural landscape but as so few of her works have been accessible to scholars this is diffulcult to establish.\\n\\nThere is also a bizarre story attached to this work that said during her time in finding the necessary materials to complete the piece - Franc became addicted to skooma and continued to threaten to cut her own ear off, until the period in which she was making these works had passed. This is usually dismissed as untrue but there are records of Franc being arressted several times in public places around Tamriel, which would coincide with the time period it is believed this work was made.',},},[6]={['Groups']=0,['EffectType']=8503,['Contrast']=1,['Id']=1196,['Z']=26591.480003,['Alpha']=1,['Color']=102439,['X']=25195.889054,['Roll']=0,['Pitch']=0,['SizeX']=26.456456,['SizeY']=30,['SizeZ']=30,['Y']=20249,['Yaw']=3.141593,['MetaData']={['title']='The Night (wolf) mare',['message']='The Night (wolf) mare\\n\\nThis work was said to have both so terrified and fascinated Franc\\'s eldest brother that he was inspired to write macacbre and romantic short stories and poetry under the pen name of E. Albert Poe. \\n\\nIt seems from the few remaining fragments of her diaries that Franc herself was very attached to this work  \"refusing several incredibly generous and increasingly insistent offers from man known only to by letter as H. Fuseli, who I feel may not have savory intentions . However. I believe this may represent a key to my  visions through the \"subconscience\". I have come to the conc...\" Unfortunately this is where the text on the fragment ends.\\n\\nVaermina\\'s nephew Sigmund Franc was likewise fascinated with this work. It appears in wood cut prints of Sigmund Franc\\'s waiting room in his pioneering work in the field of what he termed brain and heart medicine or \\'the talking cure\\'. Sigmund himself was obsessed with sculpture and his large collection can be seen in the Sigmund Franc Museum, where his office has been left intact after his death from a malady of the jaw. ',},},[7]={['Groups']=0,['EffectType']=8503,['Contrast']=1,['Id']=1197,['Z']=25769.833005,['Alpha']=1,['Color']=102439,['X']=25528.531216,['Roll']=0,['Pitch']=0,['SizeX']=26.456456,['SizeY']=30,['SizeZ']=30,['Y']=20268,['Yaw']=0,['MetaData']={['title']='Le Fox Noir',['message']='Le Fox Noir\\n\\nThere has been some debate on whether the text on this work is original to Franc or a later addition. It hung in a noisy drinking and dancing establishment in the outskirts of Waywest near the banks of the river Bjoulsae for 200 years where the locals insist that Franc herself said that it was where it needed to be.\\n In the past the pub took the name from the art work and the women who danced in the early hours for the entertainment of the clients were known as \"Le Fox\" ladies. When the premises was closed it was converted into a Rent-A-Chicken by entreprenuer Theodora Steinlein.\\n\\nThe word \"Paris\" is unknown in the languages and it surrounding dimensions. It is widely accepted that it is the name of the fox that appears in the image, whilst others say that it could be the name of a person or even a place. It has become one of the examples some experts cite as evidence that these works were inspired from sources beyond our realm, although consensus has never neen reached. ',},},[8]={['Groups']=0,['EffectType']=4407,['Contrast']=1,['Id']=1199,['Z']=25771.276293,['Alpha']=0.750000,['Color']=8,['X']=25436.147892,['Roll']=0,['Pitch']=0.020944,['SizeX']=42,['SizeY']=122,['SizeZ']=122,['Y']=20367,['Yaw']=0,['MetaData']={['message']='le\\n F\\n  N\\n\\n  Paris',},},[9]={['Groups']=0,['EffectType']=4407,['Contrast']=1,['Id']=1200,['Z']=25771.460338,['Alpha']=0.820000,['Color']=99,['X']=25450.105431,['Roll']=0,['Pitch']=0,['SizeX']=40,['SizeY']=40,['SizeZ']=40,['Y']=20378,['Yaw']=0.052360,['MetaData']={['message']='ox\\n oir',},},[10]={['Groups']=0,['EffectType']=4404,['Contrast']=0.320000,['Id']=1202,['Z']=25784.623730,['Alpha']=1,['Color']=10310,['X']=25868.090550,['Roll']=0,['Pitch']=0.164061,['SizeX']=100,['SizeY']=100,['SizeZ']=100,['Y']=20510,['Yaw']=0,['MetaData']={['message']='The\\nVaermina\\nFranc\\nGallery',},},},['Version']=1767,['TS']=1642581184,}"
