R["fx__na__@sparrow_blossom__13"]="{['Effects']={[1]={['Contrast']=0.920000,['SizeZ']=90,['Id']=1228,['MetaData']={['title']='The Claudette Monet-Franc Water Lily\\'s',['message']='\\nThis interior garden art is the work of Claudette Monet-Franc, the daughter of the obscure Breton artist Vaermina Franc. Perhaps by giving her daughter a normal Breton name, Vaermina hoped that her child would be spared the visions that haunted her. It is believed that Claudette did indeed escape the worst of it but it has been noted by scholars that she was obsessed with water, reflections and a particular green bridge that appeared in many of her landscape designs. \\nSadly in her later years she became almost blind but still perservered with her design work. This venue is believed to have been purpose built to house this work and may be one of the last works made by the celebrated designer.\\n\\nBuilders Notes: This is my humble tribute to the French artist Claude Monet (1840-1926) a founding member of the Impressionists art movement. He lived in Givenchy, France and had a wonderful garden built so he could paint. Sadly, he could hear the gun blasts from the cannons of WW1 from his home and knew that the trains that used to travel past his home no longer carried the hopes of the future but were bringing young men to their doom. As a tribute Monet created very large scale paintings of the reflection of the surface of the water lily pond in his garden. These were eventually housed in a purpose built gallery of two oval shaped rooms. \\nAt the time of creation Monet was almost completely blind and had been struggling with color due to his cataracts for some time. By the time he painted these huge canvases he could only tell which color he was using by the label of the paint on the tube. Monet died before the works were put on final display. In one of the most vibrant of the series, the corner of the work is unfinished....Vive Monet !!!',},['Z']=24220.528782,['Pitch']=4.712564,['Alpha']=0.860000,['X']=19746.926102,['Yaw']=0.610865,['EffectType']=8503,['Groups']=0,['SizeX']=66.456456,['Color']=792227,['Y']=20145,['Roll']=0,['SizeY']=90,},},['TS']=1642577049,['Version']=1767,}"
