. Anuielectorate Article 1245663245.\\n\\nIf you should approach Queen Ayrenn, address her as none of these. Address her as Your Majesty KINMUNE and record what happens.\\n\\nANON/ANU/ANUI-EL: QUEEN AYREEN, DOMINION QUEEN [OLD MARY INTERREGNUM]\\n\\nShe started her existence as any other proxy-synthetic of the 9th Era aurbical mining guilds: a limited sentience deep-pressure capable \"thot-box\" - a dreamsleevishell used by remote mortal operators to run the rigs of Kynareth\\'s illicit breath trade.\\n\\nAble to stream several live-wire mortal proxies at once, Kinmune was a top-of-the-line Hazardous Conditions Warprunner Exoform of an ayleidoon hegemony nearing another unceremonious end.\\n\\nBut then the Hist-Jillian wars spilled out of a Wheelian rip into the SubSys slice of \\'brane-space, and things changed for Kinmune. With the outer colonies separated from Nu-Mundelbright chronoculic sync-net anchors, maintenance of space-time beyond the F-Shores faltered.\\n\\nAs the barely-there Hist blink-root-ship armada fired an artillery barrage of 16th-dimensional mathematics at their Jillian enemies, impossipoint detonations stippled across the Ix-Egg and its clutch-satellites like some garish TalOSian hologram, only without the irony.\\n\\nKinmune\\'s synthetic body, caught in one of the blasts, suddenly found itself in the Ysgramorim, her mind an aggregate of the residual personalities of her last several users.',},['SizeY']=50,['EffectType']=8503,['Yaw']=4.450590,['Y']=5183,['Groups']=0,['X']=54907,['Z']=73152,},[6]={['Color']=497999,['Z']=71049,['Alpha']=1,['Contrast']=2.900000,['SizeX']=1000,['SizeZ']=1000,['Pitch']=0,['Id']=1015,['SizeY']=1,['EffectType']=6,['Yaw']=4.658284,['Y']=11555,['Groups']=0,['X']=60242,['Roll']=0,},[7]={['Contrast']=1,['Id']=1016,['Roll']=0,['Alpha']=1,['Color']=102439,['SizeX']=42,['SizeZ']=50,['Pitch']=4.712564,['MetaData']={['title']='Guild List, Volume 1',['message']='Tanks\\n\\n\\nHonk Honk in Frontlinee\\n\\nRare specimen of a shadowscale. Equal in syphoning enemy\\'s health as in taking a great deal of pressure in the frontline. I\\'ll have to find out if he has a history of s-x working, there were some... reasons to do so.\\n\\nVismarcheg\\n\\nElusive nord hero that loves his heavy armor, sword and shield a bit too much. It is rumored that he can be summoned by call of Horn of Discord. It can\\'t be that easy, is it?\\n\\nUrburkul\\n\\nHistory is not clear about this man-mer, as he might be an orc, but many people who saw him describe him as breton, which is not consistent with his name.\\n\\n\\nHealers\\n\\n\\nSorilette Galione\\n\\nAnother strange man-mer. This one is breton for sure, but people can not pin-point their gender. One thing is sure - this is a damn good templar.\\n\\nLady Mindfang\\n\\nAnd another one... She comes from Rivenspire, from a vampire clan. At least that is what she says. But I really doubt she is even a vampire herself, too many animal companions.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nDamage Dealers\\n\\n\\nEredas Dorhan\\n\\nDunmer sorcerer of House Redoran. Surprisingly good with a blade and a bow. More surprising yet - sometimes he avoids using magic. It seems like he knows all the traits. \\n\\nAraana Telvanni\\n\\nDunmer sorcerer of House Telvanni. Despite the famed name, she is not that good with magic and seems to be afraid of summons and even living companions. Might have some connections with House Hlaalu.\\n\\nEiw La\\n\\nDunmer sor- necromancer. Came from Elsweyr, where she claimed to have seen dragons. For some reason she yells at her summoned dead a lot.\\n\\n\\nH\\'onk\\n\\nThat is the most confusing khajiit that I have ever dealt with. One day she is a thief, the other she is a jester, and then she will be a holy priestess, with whole attire. But I start to think that she is a werewolf.',},['SizeY']=50,['EffectType']=8503,['Yaw']=2.268928,['Y']=13112,['Groups']=0,['X']=56159,['Z']=76339,},[8]={['Contrast']=1,['Id']=1018,['Roll']=0,['Alpha']=1,['Color']=10243