R["fx__eu__@andra_87__71"]="{['Effects']={[1]={['Y']=30080,['SizeY']=30,['Groups']=0,['Color']=102439,['EffectType']=8501,['Contrast']=1,['SizeZ']=30,['SizeX']=26.456456,['Id']=1032,['MetaData']={['message']='To Captain Drevis,\\n\\nTelvanni requirements\\n\\nCaptain, I am writing these lines to inform you that House Tellvanni is in need of some new objects. \\n\\nWe are pleased to hear, that you are targeting villages along Iliac Bay and are offering significant financial incentives for objects which have the following properties:\\n\\nSix young women, under 20 years of age, a brunette, two redheads and at least one woman, extremely fat, preferably also extremely pale. Seven young men, all under the age of twenty-four. Hair color is not important, but make sure that they are not too hairy. A strong body is crucial, as they are used for work purposes. For the other two, tall and thin would be preferred. If someone has blue eyes that would be perfect.\\n\\nTwo older men, but they must be healthy and have good eyes. They are used to monitor the behavior of others.\\n\\nFor the last object, the Look does not matter. We need someone who knows about pigs as we desperately need a new swineherd. The last one was eaten. For every object that has the properties, we offer double the usual amount. \\n\\nI wish you fast winds and safe travel.\\n\\n- Sarthis Telvanni',['title']='Correspondence',},['Z']=74943,['Pitch']=4.726352,['Roll']=0,['Alpha']=1,['Yaw']=6.192428,['X']=79572,},},['Version']=1726,['TS']=1621109252,}"
