']=8501,['Color']=499,['Z']=61516,['MetaData']={['title']='Phedre\\'s Journal, Entry 3',['message']='Disaster! Some foul river creature has attacked the steamer!\\n\\nThe captain has ordered the crew to swim for shore, but the river is teeming with befanged creatures.\\n\\nThis may be my last entry.',},['X']=56575,['Groups']=0,['SizeZ']=30,['Yaw']=1.651081,['Contrast']=1,['Roll']=0,},[4]={['Id']=1036,['Pitch']=5.372123,['SizeY']=30,['SizeX']=26.456456,['Y']=28891,['Alpha']=1,['EffectType']=8501,['Color']=30499,['Z']=64712,['MetaData']={['title']='Phedre\\'s Journal, Entry 4',['message']='I have made it to shore, but several of the crew were not so lucky.\\n\\nThe survivors managed to dry out around a bonfire, but this attracted natives from the jungle.\\n\\nUnhappily they appear to be canibals, and I have been forced to flee upriver, with those of us with enough limbs to walk.',},['X']=58437,['Groups']=0,['SizeZ']=30,['Yaw']=3.637266,['Contrast']=1,['Roll']=0,},[5]={['Id']=1037,['Pitch']=4.974188,['SizeY']=30,['SizeX']=26.456456,['Y']=28875,['Alpha']=1,['EffectType']=8501,['Color']=30099,['Z']=69333,['MetaData']={['title']='Phedre\\'s Journal, Entry 5',['message']='I have found a cave near the falls. It is filled with colorful rock drawings and strange flora.\\n\\nThankfully, the natives seem relucant to come near the entrance.\\n\\nIt appears like the cave extends into the plateau and with luck there may be another exit that will take us towards the dig site.',},['X']=56581,['Groups']=0,['SizeZ']=30,['Yaw']=3.117158,['Contrast']=1,['Roll']=0,},[6]={['Id']=1046,['Pitch']=0,['SizeZ']=1380,['SizeX']=1220,['Alpha']=1,['Y']=30623,['Color']=789959,['Z']=73430,['EffectType']=85,['X']=61918,['Groups']=0,['SizeY']=1380,['Yaw']=1.991421,['Contrast']=0.590000,['Roll']=0,},[7]={['Id']=1047,['Pitch']=0,['SizeZ']=1524,['SizeX']=1480,['Alpha']=1,['Y']=30553,['Color']=292929,['Z']=73434,['EffectType']=644,['X']=61927,['Groups']=0,['SizeY']=1524,['Yaw']=1.991421,['Contrast']=1,['Roll']=0,},[8]={['Id']=1049,['Pitch']=4.712564,['SizeZ']=1380,['SizeX']=1220,['Alpha']=1,['Y']=31314,['Color']=789959,['Z']=73724,['EffectType']=85,['X']=61297,['Groups']=0,['SizeY']=1380,['Yaw']=1.991421,['Contrast']=0.590000,['Roll']=0,},[9]={['Id']=1050,['Pitch']=4.712564,['SizeZ']=2980,['SizeX']=1620,['Alpha']=1,['Y']=30014,['Color']=789959,['Z']=72506,['EffectType']=85,['X']=63037,['Groups']=0,['SizeY']=2980,['Yaw']=2.165954,['Contrast']=0.590000,['Roll']=0,},[10]={['Id']=1053,['Pitch']=0,['SizeZ']=150000,['SizeX']=150000,['Alpha']=1,['Y']=22467,['Color']=223345,['Z']=73159,['EffectType']=909,['X']=65054,['Groups']=0,['SizeY']=150000,['Yaw']=0,['Contrast']=1,['Roll']=0,},[11]={['Id']=1054,['Pitch']=0,['SizeZ']=120000,['SizeX']=120000,['Alpha']=1,['Y']=30485,['Color']=265874,['Z']=73081,['EffectType']=533,['X']=65159,['Groups']=0,['SizeY']=120000,['Yaw']=5.302310,['Contrast']=0.620000,['Roll']=0,},[12]={['Id']=1056,['Pitch']=4.806637,['SizeY']=30,['SizeX']=26.456456,['Y']=30443,['Alpha']=1,['EffectType']=8501,['Color']=99,['Z']=71823,['MetaData']={['title']='Phedre\\'s Journal, Entry 6',['message']='I have reached the upper falls on the plateau. This is a bleak and unforgiving landscape.\\n\\nI hope I can find Professor von Bunny\\'s camp site before I starve to death among these rocks.',},['X']=61733,['Groups']=0,['SizeZ']=30,['Yaw']=2.509783,['Contrast']=1,['Roll']=0,},[13]={['Id']=1057,['Pitch']=4.712564,['SizeY']=30,['SizeX']=26.456456,['Y']=30545,['Alpha']=1,['EffectType']=8501,['Color']=30099,['Z']=70047,['MetaData']={['title']='Phedre\\'s Journal, Entry 7',['message']='I have finally arrived at Professor von Bunny\\'s camp!\\n\\nThe professor seems unconcerned about the loss of the supplies, and has put me to work straight away.\\n\\nThe professor seems quite manic, rushing about the dig site, taking measurements, and muttering about treasures greater than gold.',},['X']=64373,['Groups']=0,['SizeZ']=30,['Yaw']=1.153663,['Contrast']=1,['Roll']=0,},[14]={['Id']=1058,['Pitch']=4.708898,['SizeY']=30,['SizeX']=26.456456,['Y']=30025,['Alpha']=1,['EffectType']=8501,['Color']=99,['Z']=63288,['MetaData']={['title']='Phedre\\'s Journal, Final Entry',['message']='Professor von Bunny is quite mad! He is seeking the secret of eternal life but instead has dug up eternal death!\\n\\n... some things are not meant to be uncovered\\n\\n... some things are buried for a reason\\n\\nThe fool has freed THE WUEBEN from the weight of his eternal tomb!\\n\\nI must flee to warn the world. Our doom is upon us!\\n\\n(the jounral is signed)\\n- Lucy Phedre\\n(also know as Danger Lucy)\\n\\n*Any resemblence of these characters to actual Divine Design Alliance Guild Mistresses or Masters, living, dead, or undead,  is purely coincidental',},['X']=69604,['Groups']=0,['SizeZ']=30,['Yaw']=6.072000,['Contrast']=1,['Roll']=0,},[15]={['Id']=1059,['Pitch']=1.570971,['SizeY']=30,['SizeX']=26.456456,['Y']=30419,['Alpha']=1,['EffectType']=8501,['Color']=11499,['Z']=65913,['MetaData']={['title']='Phedre\\'s Journal, Entry 8',['message']='The workers at the dig site seem strangely unenthusatic, almost like they are in some kind of trance.\\n\\nThey just dig and dig, with no excitement at the incredible finds they uncover.',},['X']=65574,['Groups']=0,['SizeZ']=30,['Yaw']=0.212930,['Contrast']=1,['Roll']=0,},[16]={['Id']=1061,['Pitch']=1.570971,['SizeY']=30,['SizeX']=26.456456,['Y']=30418,['Alpha']=1,['EffectType']=8501,['Color']=699,['Z']=65110,['MetaData']={['title']='Phedre\\'s Journal, Entry 9',['message']='We have found an ancient tomb buried amongst the rocks of the plateau!\\n\\nWe are digging deeper to find the treasure rooms of this burial site. What fabulous antiquities will we find here?',},['X']=68037,['Groups']=0,['SizeZ']=30,['Yaw']=5.600762,['Contrast']=1,['Roll']=0,},},['TS']=1603122339,['HouseId']=71,['World']='na',},[11]={['Version']='15.7.6',['Effects']={[1]={['Id']=1060,['Pitch']=0,['SizeZ']=1360,['SizeX']=1160,['Alpha']=1,['Y']=28169,['Color']=292929,['Z']=160126,['EffectType']=644,['X']=155671,['Groups']=0,['SizeY']=1360,['Yaw']=2.029818,['Contrast']=1,['Roll']=0,},},['TS']=1602651783,['HouseId']=81,['World']='na',},[12]={['Version']='16.0.1',['Effects']={[1]={['Id']=1090,['Pitch']=0,['SizeZ']=100,['SizeX']=220,['Alpha']=1,['Y']=20549,['Color']=688899,['Z']=106979,['EffectType']=926,['X']=109629,['Groups']=0,['SizeY']=220,['Yaw']=2.897247,['Contrast']=1,['Roll']=0,},},['TS']=1607884889,['HouseId']=80,['World']='na',},[13]={['Version']='16.0.9',['Effects']={[1]={['Id']=1114,['Pitch']=0,['SizeZ']=150000,['SizeX']=150000,['Roll']=0,['Y']=1,['Color']=150059,['Z']=80960,['EffectType']=909,['X']=39980,['Groups']=0,['SizeY']=150000,['Yaw']=0,['Contrast']=1.540000,['Alpha']=1,},[2]={['Id']=1116,['Pitch']=4.852015,['SizeZ']=70,['SizeX']=65.456456,['SizeY']=70,['Roll']=0,['Y']=12440,['Color']=320099,['Z']=81060,['MetaData']={['title']='The Return of Dr Frankenbunny',['message']='Dear Reader,\\n\\nIn my role as Exquistitor Intraordinary for the Psijic Eediocy I was recently dispatched to investigate and report on the terrible outrages committed in Vardenfell, north of Gnisis, in the lead up to this years annual \"Festival of Hearts and Sexual Organs\", also refered to as \"Valentine\\'s Day\" by some, mostly pedantic Dwemer scholars.\\n\\nMy investigation was prompted by the following short note found near the scene of a brutal slaying in Vivec City. It was first supposed that this killing was the usual hourly, or perhaps minutely, occurance of a mugging in that violet city, however upon reading this note my blood ran cold, ... or perhaps colder, since that nasty bite I received some while ago has left left me rather chilled ... but I digress! The note:\\n\\n\"They thought I dead, but I have survived! I will not be defeated by a mere run-away bride! I will show them! I will show them all! I shall build a new bride, a bride to tower over the world, a bride of vengence and destuction!. They shall all cower before me, begging for their lives and longing for my love! If only I had a heart to give ... oh here\\'s one over here *snip* yes, that should do nicely! - Dr Julius Frankenbunny\"\\n\\nDear reader, the reports of Dr Frankenbunny\\'s death after that deplorable incident at Velothi Reverie, in the village of Narsis in Deshaan last year, were greatly exaggerated. He lives! Or perhaps lives again.\\n\\nIn any case it is my sad duty to inform you to EVACUATE IMMEDIATELY from the district of Vvardenfell. It appears this feind has constructed himself a new, even more terrible bride. He has created a Giant Atomic Powered Moble Romance Fortress and is marauding across the land bent on conquest, destruciton and romantic enslavement!\\n\\nFLEE! FLEE FOR YOUR LIVES!',},['X']=39986,['Groups']=0,['EffectType']=8503,['Yaw']=0.251327,['Contrast']=1,['Alpha']=1,},},['TS']=1610195348,['HouseId']=44,['World']='na',},[14]={['Version']='16.0.9',['Effects']={[1]={['Id']=1117,['Pitch']=4.712564,['SizeY']=50,['SizeX']=46.456456,['SizeZ']=50,['Alpha']=1,['Y']=9541,['Color']=280799,['Z']=46399,['MetaData']={['title']='Exterts from the Journal of Dr Frankenbunny',['message']='\" ... what is this loneliness that grinds away at my soul? I long for company in my mansion. Why can I find noone that shares my passions?\"\\n\\n\" ... the depression ebbs, replaced by rage! Am I to be alone forever? What sin have I commited to warrant such a pennance?\"\\n\\n\"... my rage has focused my mind! I see it clearly now. What God has refused to provide, I, Dr Frankenbunny, shall create!\"\\n\\n\"... all is ready! Today my beautiful creation shall live. The flux capacitors are charging nicely, and tonight I shall throw the switch and charge my love with life!\"\\n\\n\"... I do not know how I have failed! My creation rose from the table coursing with 1.21 Gigawatts of love. But as I called my freshly arisen lover to embrace me, her cold blank eyes looked through me as she spoke her first words: \\t\"... Arrrgh ... what ... have you done ... for me ... lately\"\\n\\n\"... It is no use she is too strong, I can no longer restrain her. She has smashed the main door open has is heading out into the village!\"\\n\\n\"... the screaming has mostly stopped now. But I can hear another noise. The sound of voices raised in anger. I can see many torches in the darkness, wending their way up the pathway to my house.\"\\n\\n\"... they are in the house! I have barricaded myself in my study, and am trying to record as much of this night as I can bare to recall. They are here! Smashing at my barricade, I mus ...\"',},['X']=52473,['Groups']=0,['EffectType']=8503,['Yaw']=2.530727,['Contrast']=1,['Roll']=0,},},['TS']=1610249376,['HouseId']=20,['World']='na',},},['Key']='fx__@researchmonkey',}"
